import React from "react";
import Navbar from "./components/Navbar";
import { Switch, Route } from "react-router-dom";
import LoginPage from './components/login.js';
import DoctorRegistrationPage from './components/doctorRegistration';
import { Redirect } from 'react-router';
import AdminLoginPage from './components/adminLogin';
import AddDoctorPage from './components/addDoctor';
import GrantedConsentPage from './components/grantedConsents';
import RequestConsentPage from './components/requestConsent';
let isLoggedIn = false;

function getCookie(name) {
  const value = `; ${document.cookie}`;
  const parts = value.split(`; ${name}=`);
  if (parts.length === 2) return parts.pop().split(';').shift();
}

let cookie = getCookie("patient_cookie"); 
if(cookie!=null){
  isLoggedIn = true;
  //alert("cookie there");
}
else{
  isLoggedIn = false;
}



const Home = () => {

  return (
    <>
      <Navbar />
      <section className="hero-section">
        <h1>Hospital App Home Page</h1>
      </section>
    </>
  );
};

const Login = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <LoginPage/>
      </section>
    </>
  );
};

const AdminLogin = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <AdminLoginPage/>
      </section>
    </>
  );
};

const AddDoctor = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <AddDoctorPage/>
      </section>
    </>
  );
};


const DoctorRegister= () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <DoctorRegistrationPage/>
      </section>
    </>
  );
};


const GrantedConsent= () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <GrantedConsentPage/>
      </section>
    </>
  );
};

const RequestConsent = () => {
  return (
    <>
      <Navbar />
      <section className="hero-section">
        <RequestConsentPage/>
      </section>
    </>
  );
};


const Logout= () => {
  document.cookie = "patient_cookie" + '=;expires=Thu, 01 Jan 1970 00:00:01 GMT;';

  return <Redirect to = {{ pathname: "/login" }} />;

};

const AdminLogout= () => {
  document.cookie = "admin_cookie" + '=;expires=Thu, 01 Jan 1970 00:00:01 GMT;';

  return <Redirect to = {{ pathname: "/login-admin" }} />;

};


const App = () => {
  return (
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>

      <Route path="/login">
        <Login />
      </Route>

      <Route path="/login-admin">
        <AdminLogin />
      </Route>

      <Route path="/add-doctor">
        <AddDoctor />
      </Route>

      <Route path="/register-doctor">
        <DoctorRegister />
      </Route>

      <Route path="/logout">
        <Logout />
      </Route>

      <Route path="/logout-admin">
        <AdminLogout />
      </Route>
      <Route path="/granted-consents">
        <GrantedConsent />
      </Route>
      <Route path="/request-consents">
        <RequestConsent />
      </Route><Route path="/view-ehr/:patientId/:consentId">
        <ViewEHR />
      </Route>

    </Switch>
  );
};

export default App;
